[{'comment_id': 689091996, 'comment_body': 'These should be more restricted. According to this rule any user can update any users' info. This should be something like 
```
"users": {
      "$uid": {
        ".write": "$uid === auth.uid"
    }
}
```
where this will only grant edit access to the relevant use who has the uid. Same as this, rules should be there for each possible unit data(which means if there are two collections starts with users -> ex: users/uid, users/profile, each case should have their own rule if the rule is different, if the collection shares a common rule, we can use regex method that you have already used in here). Update the rules accordingly. And when committing, let's create a separate directory to store the rules instead adding them to the root directory. I suggest directory -> firebase_rules, if there is more convenient name, let's use that.

